  return (
    <div>
        <Routes>
<Route path={"/"} element={<Products/>}  />
<Route path='/cart' element={<Cart/>}/>
<Route path='/products/description/:id' element={<Description/>}  />

        </Routes>
    </div>
  )
}

export default Mainroutes
